INSERT INTO `projects` VALUES (143,'images/me0.png','me','Line messenger',35.00,'國家選Indonesia印度尼西亞或Germany德國，獲取號碼開始跑次數後2秒傳送驗證碼(抓時間大概5秒沒有收到重新傳送驗證碼)，已經給號碼傳送驗證簡訊後沒有收到必須拉黑避免收到驗證碼簡訊扣餘額','2020-05-24 18:07:13','2020-05-29 19:49:39'),(144,'images/ub0.png','ub','Uber',15.00,'<p>國家選俄羅斯註冊不要加國碼，獲取號碼開始跑次數後2秒傳送驗證碼(抓時間大概5秒沒有收到重新傳送驗證碼)，已經給號碼傳送驗證簡訊後沒有收到必須拉黑避免收到驗證碼簡訊扣餘額，保證沒有註冊過新的(被註冊過會補)，不保證能使用優惠卷，請自己找方法，注意IP多開瀏覽器會造成優惠卷不能使用</p><p>1.平常方式使用(優先)不能在用以下方法2.多開大師或其他多開app+VPN註冊3~5個換一次IP3.多開大師或其他多開app開火狐或其他瀏覽器創一個開關飛航4.瀏覽器註冊用vpn或開關飛航5.電腦模擬器+VPN</p><p>Uber嚴格系統，不是號碼問題，購買使用表示同意風險<img src=\"/uploads/tinymce/images/fba6f1cea3db9aa82f999380a104261e5ed2665691545.jpg\" alt=\"\" width=\"200\" height=\"200\"></p>','2020-05-26 02:50:13','2020-05-30 14:04:23'),(145,'images/79a276620bdd0ec8022626b5ec371008.png','nz','Foodpanda',15.00,NULL,'2020-05-26 18:42:10','2020-05-29 16:07:56');
